import React from "react";
import { Container } from "react-bootstrap";
import { BrowserRouter as Router, Route} from "react-router-dom";
import Page from "../components/Page";

function App() {
  return (
    <Router>
      <main className="py-3">
        <Container>
          <Route path="/:id" component={Page} />
        </Container>
      </main>
    </Router>
  );
}

export default App;
